  display: flex;
  flex-direction: column;
  width: 100%;
  background-color: #0a0e11;
  height: 100vh;
  color: white;
`;

const Header = styled.div`
    color: white; 
    width: 100%; 
    font-weight: bold; 
    background-color: #56bca6; 
    padding: 50px 50px 140px; 
    font-size: 14px;
`;


const LoginComponent = () => {
    return  <Container>
        <Header>WhatsApp Clone</Header>
    </Container>;
};

export default LoginComponent;
